      })} */}
      <div className={styles.commentContainer}>
        <div className={styles.hiddenWrapper}>
          <div className={styles.commentsWrapper}>
            <div className={styles.commentBox}>
              <div className={styles.commentImg}></div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};
export default Comments;
